import React, { Component } from 'react'
import PhoneNumberHead from './PhoneNumberHead'
import PhoneNumberMid from './PhoneNumberMid'

class PhoneNumber extends Component {
    render() {
        return (
            <div className="wrapper">
                <PhoneNumberHead />
                <PhoneNumberMid props={this.props.props}/>
            </div>
        )
    }
}
export default PhoneNumber
